import React, { Component } from "react";
import Link from 'next/link';
import Contacts from "../contacts/Contacts";
import AddContact from "../contacts/AddContact";
import EditContact from "../contacts/EditContact";
import Header from "../layout/Header";
import About from "../pages/About";
import NotFound from "../pages/NotFound";
import Test from "../test/Test";

import { Provider } from "../context/context";



class Prub extends Component {
    render() {
        return (
            // We wrap everything in the provider due to global state
            <Provider>
                <Link>
                    <div className="App">
                        <Header branding="Contact Manager" />
                        <div className="container">
                            <Link>
                                <Link exact path="/" component={Contacts} />
                                <Link exact path="/contact/add" component={AddContact} />
                                <Link exact path="/contact/edit/:id" component={EditContact} />
                                <Link exact path="/about" component={About} />
                                <Link exact path="/test" component={Test} />
                                <Link component={NotFound} />
                            </Link>
                        </div>
                    </div>
                </Link>
            </Provider>
        );
    }
}

export default Prub;
